#include <linux/fb.h>

#include "LCDControl.h"


// 启动接口,初始化屏幕并show
void lcd_start(int groupsize) {
    init_screen();

    init_array(&line, info.xres/groupsize, 0, groupsize);
    brush_screen(0x00, 0X00, 0x00); // 黑屏并将缓冲区置0
    paint_cross();
    show(); // 缓冲区拷贝展示
}


// 结束接口
void stop() {
    clean();
}


// 温度环形缓冲区接口,不绘制
void push(const int value) {
    push_queue(&line, value);
}


// 屏幕刷新绘制接口,调用show绘制
void refresh() {
    refresh_screen(&line);
    show(); // 缓冲区拷贝
}


